  false,\n\t\"url\": null,\n\t\"notes\": \"Every year, shorebird biologists and beach
  managers decide whether to use wire cages (i.e., exclosures) to reduce predator
  access to nests of approximately 1,500 pairs of U.S. Atlantic Coast piping plovers
  (Charadrius melodus). Although these decisions must be consistent with written authorizations
  from the State wildlife agencies, discretion to deploy exclosures is often conferred
  on experienced local biologists who factor current conditions at more than 250 sites
  into decisions about whether to use exclosures in site- or nest-specific situations.
  There is an ongoing debate over how effectively predator exclosures increase productivity,
  as well as their potential negative effects on survival of breeding adults. The
  goal of this decision analysis was to maximize piping plover population growth rates
  by providing local biologists with a decision framework to determine, on a yearly,
  site-, and nest-specific basis, when to erect predator exclosures.\",\n\t\"owner_org\":
